	//Read & set the image src - base64 format - modern browser
	function readImage(input) {
			if ( input.files && input.files[0] ) {
				var FR= new FileReader();
				FR.onload = function(e) {
					$(input).parent().find("img").attr( "src", e.target.result );
				};       
				FR.readAsDataURL( input.files[0] );
			}
		}
	
	//return base64 url for IE9+	
	function getBase64Image(img) {		
		// Create an empty canvas element
		var canvas = document.getElementById("c");
		canvas.width = img.width;
		canvas.height = img.height;

		// Copy the image contents to the canvas
		var ctx = canvas.getContext("2d");
		ctx.drawImage(img, 0, 0);

		// Get the data-URL formatted image
		var dataURL = canvas.toDataURL("image/png");

		return dataURL;//.replace(/^data:image\/(png|jpg);base64,/, "");
	}
	
	//Read & set the image src - base64 format - ie > 9
	function readImageForIe(input) {
		//$(input).parent().find("img").attr( "src", input[0].value );
		var getImg = $(input).parent().find("img");

		var bannerImage = document.getElementById(getImg[0].id);
		var imgData = getBase64Image(bannerImage);
		//alert(imgData);
		//console.log(imgData);
		$(input).parent().find("img").attr( "src", imgData );
	}
	
	function createImagesJSONAttachement(){
		var ramdomNumber = 'nliaemail'
		var getImages = $("div.divContent img");
		var attachmentObj = {};
		var i=0;
		for(; i<getImages.length; i++){
			if($(getImages[i]).attr('src').indexOf("base64") > 0){
				//fill attachment object
				attachmentObj.type = "image/png";
				attachmentObj.name = ramdomNumber + i;
				attachmentObj.content = $(getImages[i]).attr('src');
				//add object to attachement array.
				attachmentArray.push(attachmentObj);
				//change image src
				$(getImages[i]).attr("src","cid:" + ramdomNumber + i);
			}
		}
	}
	
